import { useContext } from "react";
import { ReceiverListContext, ReceiverObjectProps } from "../../State Management/ReceiverListContext";
import { Box } from "@mui/material";
import { DeviceBig } from "./DeviceBig";

type ReceiverListByType = {
    [key: string]: ReceiverObjectProps[]
}


export const MainPage = () => {
    const receiverList = useContext(ReceiverListContext);

    const receiverListByType = receiverList?.reduce<ReceiverListByType>((types, receiver) => {
        const type = receiver.type;
        //If type key doesn't exist yet in acc (types), add it
        if (!types[type]) {
            types[type] = [];
        }
        types[type].push(receiver);
        return types;
    }, {});
    console.log(receiverListByType)
    return (
        <Box>
            {receiverListByType && receiverListByType["Bass Drum"].map((receiver) => {
                <DeviceBig id={receiver.id} name={receiver.name} IP={receiver.IP}/>
            })}
        </Box>
    )
}
